css:
.conflict-resolved {
  background: #414346;
}
.conflict-ours {
  background: rgba(67, 208, 138, 0.4);
}
.conflict-ours.cursor-line {
  background: rgba(67, 208, 138, 0.3);
}
.conflict-theirs {
  background: rgba(51, 160, 255, 0.4);
}
.conflict-theirs.cursor-line {
  background: rgba(51, 160, 255, 0.3);
}
.conflict-dirty {
  background: rgba(51, 160, 255, 0.4);
}
.conflict-dirty.cursor-line {
  background: rgba(51, 160, 255, 0.3);
}
